import React, { Component } from 'react'
import Button from "./Button"

class Calendar extends Component{
    constructor(props) {
        super(props)
        this.state = {
            step: 0,
        }
    }

    images = ["date_1.png", "date_2.png", "date_3.png", "date_4.png", "date_5.png"]

    click = () => {
        const nextstep = this.state.step + 1
        if(nextstep <= this.images.length - 1){
          this.setState({
              step: nextstep,
          })
        }
    }

    goToLoading = () => {
      console.log(this.props);
    }

    render() {
        return (
          <div className = "calendar-container">
            <div onClick={this.click}>
                <img src={this.images[this.state.step]}/>
            </div>
            {this.state.step >= 4 && <Button
              buttonText = "See My Recommendations"
              isActive = {true}
              width="100%"
              onButtonClick = {this.goToLoading}/>}
          </div>
        )
    }
}

export default Calendar
